import React, { useEffect } from 'react';
import axios from "axios";
const Result = () => {

    useEffect(()=>{
        axios.get("kar/auteur").then((res)=>console.log(res))
    },[])

    return (
        <div className="Result">
            <h1> Liste des resultat</h1>
        </div>
    );
};

export default Result;
